function fill_roeExcess10(){
  let idx;

  if(roe_f3!=0){
    idx=2;

    roeExcess10_arr[0]=roe_f1-input_rate;
    roeExcess10_arr[1]=roe_f2-input_rate;
    roeExcess10_arr[2]=roe_f3-input_rate;
  }else if(roe_f2!=0){
    idx=1;

    roeExcess10_arr[0]=roe_f1-input_rate;
    roeExcess10_arr[1]=roe_f2-input_rate;
  }else{
    idx=0;

    roeExcess10_arr[0]=roe_f1-input_rate;
  }


  for (let i=idx; i<9; i++){
    roeExcess10_arr[i+1]=(roeExcess10_arr[i]*1);
  }
}

function fill_roeExcess9(){
  let idx;

  if(roe_f3!=0){
    idx=2;

    roeExcess9_arr[0]=roe_f1-input_rate;
    roeExcess9_arr[1]=roe_f2-input_rate;
    roeExcess9_arr[2]=roe_f3-input_rate;
  }else if(roe_f2!=0){
    idx=1;

    roeExcess9_arr[0]=roe_f1-input_rate;
    roeExcess9_arr[1]=roe_f2-input_rate;
  }else{
    idx=0;

    roeExcess9_arr[0]=roe_f1-input_rate;
  }


  for (let i=idx; i<9; i++){
    roeExcess9_arr[i+1]=(roeExcess9_arr[i]*0.9);
  }
}

function fill_roeExcess8(){
  let idx;

  if(roe_f3!=0){
    idx=2;

    roeExcess8_arr[0]=roe_f1-input_rate;
    roeExcess8_arr[1]=roe_f2-input_rate;
    roeExcess8_arr[2]=roe_f3-input_rate;
  }else if(roe_f2!=0){
    idx=1;

    roeExcess8_arr[0]=roe_f1-input_rate;
    roeExcess8_arr[1]=roe_f2-input_rate;
  }else{
    idx=0;

    roeExcess8_arr[0]=roe_f1-input_rate;
  }


  for (let i=idx; i<9; i++){
    roeExcess8_arr[i+1]=(roeExcess8_arr[i]*0.8);
  }
}


function fill_roePredict10(){
  for(let i=0; i<10; i++){
    roePredict_arr[i]=roeExcess10_arr[i]+input_rate;
  }
}

function fill_roePredict9(){
  for(let i=0; i<10; i++){
    roePredict_arr[i]=roeExcess9_arr[i]+input_rate;
  }
}

function fill_roePredict8(){
  for(let i=0; i<10; i++){
    roePredict_arr[i]=roeExcess8_arr[i]+input_rate;
  }
}

function fill_netIncome_share(){
  netIncome_arr[0]=(capital*roePredict_arr[0]/100);
  share_arr[0]=netIncome_arr[0]+capital;

  for(let i=1; i<10; i++){
    netIncome_arr[i]=(share_arr[i-1]*roePredict_arr[i]/100);
    share_arr[i]=share_arr[i-1]+netIncome_arr[i];
  }
}

function excessProfit(){
  excessProfit_arr[0]=capital*(roePredict_arr[0]-input_rate)/100;

  for(let i=1; i<10; i++){
    excessProfit_arr[i]=share_arr[i-1]*(roePredict_arr[i]-input_rate)/100;
  }
}

function NPV_claculate(_input_rate, year){
  let NPV=0;
  for(let i=1; i<=year; i++){
    NPV+=excessProfit_arr[i-1]/((_input_rate/100+1)**i);
  }

  return NPV;
}


const getHtml = async (code) => {
  try {
    
    const axios = require("axios");
    const cheerio = require("cheerio");

    
    const html = await axios.get("http://comp.fnguide.com/SVO2/ASP/SVD_Main.asp?pGB=1&gicode=A"+code+"&cID=&MenuYn=Y&ReportGB=&NewMenuID=11&stkGb=701");
    const $ = cheerio.load(html.data);


    //capital, roe_f1, roe_f2, roe_f3, totalStock
    const bodyList = $("div#highlight_D_Y");

    bodyList.find('tr:nth-of-type(10)').each((i, element) => {
      let crawl_text = $(element).find('td:nth-of-type(5)').text();
      capital=parseFloat(crawl_text.replaceAll(",","")); //capital
    });

    bodyList.find('tr:nth-of-type(18)').each((i, element) => {
      let crawl_text = $(element).find('td:nth-of-type(6)').text()
      roe_f1=parseFloat(crawl_text.replaceAll(",","")); //roe_f1

      crawl_text = $(element).find('td:nth-of-type(7)').text()
      roe_f2=parseFloat(crawl_text.replaceAll(",","")); //roe_f2

      crawl_text = $(element).find('td:nth-of-type(8)').text()
      roe_f3=parseFloat(crawl_text.replaceAll(",","")); //roe_f3

      crawl_text = $(element).find('td:nth-of-type(3)').text()
      roe_p1=parseFloat(crawl_text.replaceAll(",","")); //roe_p1

      crawl_text = $(element).find('td:nth-of-type(4)').text()
      roe_p2=parseFloat(crawl_text.replaceAll(",","")); //roe_p2

      crawl_text = $(element).find('td:nth-of-type(5)').text()
      roe_p3=parseFloat(crawl_text.replaceAll(",","")); //roe_p3
    });

    bodyList.find('tr:nth-of-type(24)').each((i, element) => {
      let crawl_text = $(element).find('td:nth-of-type(5)').text()
      totalStock=parseFloat(crawl_text.replaceAll(",","")); //totalStock
    });


    //companyStock
    const bodyList2 = $("div#svdMainGrid5");

    bodyList2.find('tr:nth-of-type(5)').each((i, element) => {
      let crawl_text = $(element).find('td:nth-of-type(2)').text()
      
      companyStock=parseFloat(crawl_text.replaceAll(",","")); //companyStock 

      if(isNaN(companyStock)){ //자기주식 없을 때 
        companyStock=0;
      }

    });

    stocks=totalStock*1000-companyStock;


    //Stock Price
    const bodyList3 = $("div#svdMainGrid1");

    bodyList3.find('tr:nth-of-type(1)').each((i, element) => {
      let crawl_text = $(element).find('td:nth-of-type(1)').text()

      for(let i=0; i<crawl_text.length; i++){ //70,700/ -500 이런식으로 나와서 "/"이후 값 자르기
        if(crawl_text[i]=="/"){
          stock_price=crawl_text.slice(0,i);
          break
        }
      }
    });

  } catch (error) {
    console.error(error);
  }
};


function price_0y_calculate(decrease_rate){ // 성장반영X 계산 (rate:요구수익률, )
  let price=(capital*100000000+(capital*100000000*(roe_f1-input_rate)/100)*(decrease_rate/10)/(1+(input_rate/100)-(decrease_rate/10)))/stocks

  return price;
}


